        private const ushort VGA_AC_INDEX = 0x3C0;
        private const ushort VGA_AC_WRITE = 0x3C0;
        private const ushort VGA_AC_READ = 0x3C1;
        private const ushort VGA_MISC_WRITE = 0x3C2;
        private const ushort VGA_SEQ_INDEX = 0x3C4;
        private const ushort VGA_SEQ_DATA = 0x3C5;
        private const ushort VGA_DAC_READ_INDEX = 0x3C7;
        private const ushort VGA_DAC_WRITE_INDEX = 0x3C8;
        private const ushort VGA_DAC_DATA = 0x3C9;
        private const ushort VGA_MISC_READ = 0x3CC;
        private const ushort VGA_GC_INDEX = 0x3CE;
        private const ushort VGA_GC_DATA = 0x3CF;
        private const ushort VGA_CRTC_INDEX = 0x3D4;		/* 0x3B4 */
        private const ushort VGA_CRTC_DATA = 0x3D5;		/* 0x3B5 */
        private const ushort VGA_INSTAT_READ = 0x3DA;

        private const ushort VGA_NUM_SEQ_REGS = 5;
        private const ushort VGA_NUM_CRTC_REGS = 25;
        private const ushort VGA_NUM_GC_REGS = 9;
        private const ushort VGA_NUM_AC_REGS = 21;
        private const ushort VGA_NUM_REGS = (1 + VGA_NUM_SEQ_REGS + VGA_NUM_CRTC_REGS +
                        VGA_NUM_GC_REGS + VGA_NUM_AC_REGS);

        private static byte inportb(ushort port)
        {
            return CPUBus.Read8(port);
        }


        private unsafe static void WriteVGARegisters(byte[] registers)
        {
            fixed (byte* reg = registers)
            {
                byte* regs = reg;
                byte i;

                /* write MISCELLANEOUS reg */
                CPUBus.Write8(VGA_MISC_WRITE, *regs);
                regs++;
                /* write SEQUENCER regs */
                for (i = 0; i < VGA_NUM_SEQ_REGS; i++)
                {
                    CPUBus.Write8(VGA_SEQ_INDEX, i);
                    CPUBus.Write8(VGA_SEQ_DATA, *regs);
                    regs++;
                }
                /* unlock CRTC registers */
                CPUBus.Write8(VGA_CRTC_INDEX, 0x03);
                CPUBus.Write8(VGA_CRTC_DATA, (byte)(inportb(VGA_CRTC_DATA) | 0x80));
                CPUBus.Write8(VGA_CRTC_INDEX, 0x11);
                CPUBus.Write8(VGA_CRTC_DATA, (byte)(inportb(VGA_CRTC_DATA) & 0x7f));
                /* make sure they remain unlocked */
                regs[0x03] |= 0x80;
                regs[0x11] &= 0x7f;
                /* write CRTC regs */
                for (i = 0; i < VGA_NUM_CRTC_REGS; i++)
                {
                    CPUBus.Write8(VGA_CRTC_INDEX, i);
                    CPUBus.Write8(VGA_CRTC_DATA, *regs);
                    regs++;
                }
                /* write GRAPHICS CONTROLLER regs */
                for (i = 0; i < VGA_NUM_GC_REGS; i++)
                {
                    CPUBus.Write8(VGA_GC_INDEX, i);
                    CPUBus.Write8(VGA_GC_DATA, *regs);
                    regs++;
                }
                /* write ATTRIBUTE CONTROLLER regs */
                for (i = 0; i < VGA_NUM_AC_REGS; i++)
                {
                    inportb(VGA_INSTAT_READ);
                    CPUBus.Write8(VGA_AC_INDEX, i);
                    CPUBus.Write8(VGA_AC_WRITE, *regs);
                    regs++;
                }
                /* lock 16-color palette and unblank display */
                inportb(VGA_INSTAT_READ);
                CPUBus.Write8(VGA_AC_INDEX, 0x20);
            }
        }
        private static void set_plane(byte p)
        {
            byte pmask;

            p &= 3;
            pmask = (byte)(1 << p);
            /* set read plane */
            CPUBus.Write8(VGA_GC_INDEX, 4);
            CPUBus.Write8(VGA_GC_DATA, p);
            /* set write plane */
            CPUBus.Write8(VGA_SEQ_INDEX, 2);
            CPUBus.Write8(VGA_SEQ_DATA, pmask);
        }

        //int offset = 0xb8000;
        static int get_fb_seg()
        {
            int seg;

            CPUBus.Write8(VGA_GC_INDEX, 6);
            seg = inportb(VGA_GC_DATA);
            seg >>= 2;
            seg &= 3;
            switch (seg)
            {
                case 0:
                case 1:
                    seg = 0xA0000;
                    break;
                case 2:
                    seg = 0xB0000;
                    break;
                case 3:
                    seg = 0xB8000;
                    break;
            }
            return seg;
        }

        private static unsafe void WriteFont(byte[] font, byte font_height)
        {
            byte seq2, seq4, gc4, gc5, gc6;

            /* save registers
        set_plane() modifies GC 4 and SEQ 2, so save them as well */
            CPUBus.Write8(VGA_SEQ_INDEX, 2);
            seq2 = inportb(VGA_SEQ_DATA);

            CPUBus.Write8(VGA_SEQ_INDEX, 4);
            seq4 = inportb(VGA_SEQ_DATA);
            /* turn off even-odd addressing (set flat addressing)
            assume: chain-4 addressing already off */
            CPUBus.Write8(VGA_SEQ_DATA, (byte)(seq4 | 0x04));

            CPUBus.Write8(VGA_GC_INDEX, 4);
            gc4 = inportb(VGA_GC_DATA);

            CPUBus.Write8(VGA_GC_INDEX, 5);
            gc5 = inportb(VGA_GC_DATA);
            /* turn off even-odd addressing */
            CPUBus.Write8(VGA_GC_DATA, (byte)(gc5 & ~0x10));

            CPUBus.Write8(VGA_GC_INDEX, 6);
            gc6 = inportb(VGA_GC_DATA);
            /* turn off even-odd addressing */
            CPUBus.Write8(VGA_GC_DATA, (byte)(gc6 & ~0x02));
            /* write font to plane P4 */
            set_plane(2);
            /* write font 0 */
            int seg = get_fb_seg();
            for (int i = 0; i < 256; i++)
                for (int j = 0; j < font_height; j++)
                    *((byte*)(seg + i * 32 + j)) = font[i * font_height + j];


            /* restore registers */
            CPUBus.Write8(VGA_SEQ_INDEX, 2);
            CPUBus.Write8(VGA_SEQ_DATA, seq2);
            CPUBus.Write8(VGA_SEQ_INDEX, 4);
            CPUBus.Write8(VGA_SEQ_DATA, seq4);
            CPUBus.Write8(VGA_GC_INDEX, 4);
            CPUBus.Write8(VGA_GC_DATA, gc4);
            CPUBus.Write8(VGA_GC_INDEX, 5);
            CPUBus.Write8(VGA_GC_DATA, gc5);
            CPUBus.Write8(VGA_GC_INDEX, 6);
            CPUBus.Write8(VGA_GC_DATA, gc6);
        }

        public static SetPixelDelegate SetPixel = new SetPixelDelegate(SetPixelNoMode);

        public delegate void SetPixelDelegate(uint x, uint y, uint c);

        public enum TextSize { Size40x25, Size40x50, Size80x25, Size80x50, Size90x30, Size90x60 };

        public static void SetTextMode(TextSize aSize) {
            switch (aSize) {
                case TextSize.Size40x25:
                    WriteVGARegisters(g_40x25_text);
                    WriteFont(g_8x16_font, 16);
                    break;
                case TextSize.Size40x50:
                    WriteVGARegisters(g_40x50_text);
                    WriteFont(g_8x8_font, 8);
                    break;
                case TextSize.Size80x25:
                    WriteVGARegisters(g_80x25_text);
                    WriteFont(g_8x16_font, 16);
                    break;
                case TextSize.Size80x50:
                    WriteVGARegisters(g_80x50_text);
                    WriteFont(g_8x8_font, 8);
                    break;
                case TextSize.Size90x30:
                    WriteVGARegisters(g_90x30_text);
                    WriteFont(g_8x16_font, 16);
                    break;
                case TextSize.Size90x60:
                    WriteVGARegisters(g_90x60_text);
                    WriteFont(g_8x8_font, 8);
                    break;
                default:
                    throw new Exception("Invalid text size.");
            }
        }

