        public static void SetMode320x200x8()
        {
            WriteVGARegisters(g_320x200x256);

            PixelWidth = 320;
            PixelHeight = 200;
            Colors = 256;
            SetPixel = new SetPixelDelegate(SetPixel320x200x8);
        }
        public static void SetMode640x480x4()
        {
            WriteVGARegisters(g_640x480x16);

            PixelWidth = 640;
            PixelHeight = 480;
            Colors = 16;
            SetPixel = new SetPixelDelegate(SetPixel640x480x4);
        }

        private static unsafe void SetPixelNoMode(uint x, uint y, uint c)
        {
            throw new Exception("No video mode set!");
        }
        public static unsafe void SetPixel640x480x4(uint x, uint y, uint c)
        {
            byte* address = (byte*)(0xa0000 + y * 320 + x >> 1);

            c = c & 0xf;
            if ((x & 1) == 0)
            {
                *address = (byte)(((byte)((*address) & 0xf)) | (byte)(c << 4));
            }
            else
            {
                *address = (byte)(((byte)((*address) & 0xf0)) | (byte)c);
            }
        }
        public static unsafe void SetPixel320x200x8(uint x, uint y, uint c)
        {
            *(byte*)(0xa0000 + y * 320 + x) = (byte)(c & 0xff);
        }
        public static unsafe uint GetPixel320x200x8(uint x, uint y)
        {
            return *(byte*)(0xa0000 + y * 320 + x);
        }

